import Navbar from "./Components/Navbar/Navbar";
import MainPage from "./Components/MainPage/MainPage";
import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (<>
        <Navbar/>
        <Routes>
            <Route path="/" element={MainPage}/>
        </Routes>

          MainPage
    </>

  );
}

export default App;
